import { createMuiTheme} from '@mui/material';


const lightTheme = createMuiTheme({
  palette: {
    primary: {
      main: '#388e3c',
      light: '#66bb6a',
      dark: '#2e7d32',
    },
    Button: {
        backgroundColor: "grey",
      border: 0,
      borderRadius: 3,
      boxShadow: "0 3px 5px 2px",
      color: "black",
      height: 48,
      padding: "0 30px"
    }
  }
})


const darkTheme = createMuiTheme({
  palette: {
    mode: 'dark',
  }
})

export default lightTheme;
